// geoprumo/frontend/src/components/Upload/Uploader.jsx

import React, { useState } from 'react';

// Este componente receberá uma função 'onProcess' do App.jsx
function Uploader({ onProcess, isLoading }) {
  const [activeTab, setActiveTab] = useState('files');
  const [files, setFiles] = useState([]);
  const [links, setLinks] = useState('');
  const [rawText, setRawText] = useState('');

  const handleFileChange = (event) => {
    // Converte a FileList para um array para facilitar a manipulação
    setFiles(Array.from(event.target.files));
  };

  const handleSubmit = () => {
    // Futuramente, aqui faremos a conversão dos arquivos para Base64
    // Por enquanto, apenas passamos os dados para o componente pai
    const payload = {
      files: files, // Em um passo futuro, isso será { filename, content }
      links: links.split('\n').filter(link => link.trim() !== ''),
      texts: [rawText],
    };
    onProcess(payload);
  };

  const renderTabContent = () => {
    switch (activeTab) {
      case 'files':
        return (
          <div>
            <label 
              htmlFor="file-upload" 
              className="flex justify-center w-full h-32 px-4 transition bg-white border-2 border-gray-300 border-dashed rounded-md appearance-none cursor-pointer hover:border-gray-400 focus:outline-none">
              <span className="flex items-center space-x-2">
                <svg xmlns="http://www.w3.org/2000/svg" className="w-6 h-6 text-gray-600" fill="none" viewBox="0 0 24 24" stroke="currentColor" strokeWidth="2">
                  <path strokeLinecap="round" strokeLinejoin="round" d="M7 16a4 4 0 01-4-4V6a4 4 0 014-4h1.586a1 1 0 01.707.293l1.414 1.414a1 1 0 00.707.293H12a4 4 0 014 4v1.586a1 1 0 00.293.707l1.414 1.414a1 1 0 01.293.707V16a4 4 0 01-4 4H7z" />
                </svg>
                <span className="font-medium text-gray-600">
                  Arraste arquivos ou <span className="text-blue-600 underline">procure</span>
                </span>
              </span>
              <input type="file" id="file-upload" name="file-upload" multiple className="hidden" onChange={handleFileChange} />
            </label>
            <div className="mt-2 text-sm text-gray-500">
              {files.length > 0 ? (
                <ul>{files.map(f => <li key={f.name}>- {f.name}</li>)}</ul>
              ) : "Nenhum arquivo selecionado."}
            </div>
          </div>
        );
      case 'links':
        return (
          <textarea
            className="w-full h-32 p-2 border rounded"
            placeholder="Cole um ou mais links, um por linha..."
            value={links}
            onChange={(e) => setLinks(e.target.value)}
          />
        );
      case 'text':
        return (
          <textarea
            className="w-full h-32 p-2 border rounded"
            placeholder="Cole os dados da sua planilha aqui (formato CSV)..."
            value={rawText}
            onChange={(e) => setRawText(e.target.value)}
          />
        );
      default:
        return null;
    }
  };

  return (
    <div>
      {/* Abas de Navegação */}
      <div className="border-b border-gray-200 mb-4">
        <nav className="-mb-px flex space-x-4" aria-label="Tabs">
          <button onClick={() => setActiveTab('files')} className={`${activeTab === 'files' ? 'border-blue-500 text-blue-600' : 'border-transparent text-gray-500 hover:text-gray-700 hover:border-gray-300'} whitespace-nowrap py-2 px-1 border-b-2 font-medium text-sm`}>
            Arquivos
          </button>
          <button onClick={() => setActiveTab('links')} className={`${activeTab === 'links' ? 'border-blue-500 text-blue-600' : 'border-transparent text-gray-500 hover:text-gray-700 hover:border-gray-300'} whitespace-nowrap py-2 px-1 border-b-2 font-medium text-sm`}>
            Links
          </button>
          <button onClick={() => setActiveTab('text')} className={`${activeTab === 'text' ? 'border-blue-500 text-blue-600' : 'border-transparent text-gray-500 hover:text-gray-700 hover:border-gray-300'} whitespace-nowrap py-2 px-1 border-b-2 font-medium text-sm`}>
            Colar Texto
          </button>
        </nav>
      </div>
      
      {/* Conteúdo da Aba Ativa */}
      {renderTabContent()}

      {/* Botão de Ação Principal */}
      <button 
        onClick={handleSubmit}
        disabled={isLoading}
        className="mt-4 w-full bg-blue-600 text-white font-bold py-2 px-4 rounded hover:bg-blue-700 disabled:bg-gray-400 flex items-center justify-center"
      >
        {isLoading && (
          <svg className="animate-spin -ml-1 mr-3 h-5 w-5 text-white" xmlns="http://www.w3.org/2000/svg" fill="none" viewBox="0 0 24 24">
            <circle className="opacity-25" cx="12" cy="12" r="10" stroke="currentColor" strokeWidth="4"></circle>
            <path className="opacity-75" fill="currentColor" d="M4 12a8 8 0 018-8V0C5.373 0 0 5.373 0 12h4zm2 5.291A7.962 7.962 0 014 12H0c0 3.042 1.135 5.824 3 7.938l3-2.647z"></path>
          </svg>
        )}
        {isLoading ? 'Processando...' : 'Analisar e Otimizar com IA'}
      </button>
    </div>
  );
}

export default Uploader;
